import { Grid, ImageList, ImageListItem } from "@mui/material";
import React from "react";
import { useSelector } from "react-redux";

const Dashboard = () => {
    const allTasks = JSON.parse(localStorage.getItem('allTasks'));

    const textStyle = {
        titles: {
            color: '#f5f5f5',
            display: 'flex',
            justifyContent: 'center',
        },
        values: {
            margin: 0,
            color: '#f5f5f5',
            display: 'flex',
            justifyContent: 'center',
            fontSize: 45
        }
    }

    return (
        <Grid container columnGap={3} rowGap={2} marginTop={'1em'} justifyContent={'center'}>
            <Grid
                container
                item
                border={1}
                borderRadius={4}
                xs={3}
                height={'10em'}
                bgcolor={'#262626'}
                justifyContent={'center'}
                sx={{ boxShadow: 4 }}
            >
                <Grid item xs={12} justifyItems={'center'}>
                    <h1 style={textStyle.titles}>Number of tasks:</h1>
                </Grid>
                <Grid item xs={12}>
                    <h1 style={textStyle.values}>{allTasks}</h1>
                </Grid>
            </Grid>
            <Grid item border={1} borderRadius={4} xs={8} height={'10em'} bgcolor={'#262626'} sx={{ boxShadow: 4 }}>
                
            </Grid>
            <Grid item border={1} borderRadius={4} xs={8} height={'10em'} bgcolor={'#262626'} sx={{ boxShadow: 4 }}>
                
            </Grid>
            <Grid item border={1} borderRadius={4} xs={3} height={'10em'} bgcolor={'#262626'} sx={{ boxShadow: 4 }}>
                
            </Grid>
        </Grid>
    )
}

export default Dashboard;
